Ben gerçekten fıstık ağacının bu kadar güzel olduğunu bilmiyordum 🩷

@nestledamak ve @temavakfi 'nin, fıstık tarımının gelişimini desteklemek için 12 yıldır sürdürdüğü Türkiye’nin en uzun soluklu tarım projesi olan “Fıstığımız Bol Olsun” projesini yerinde görebilmek için Gaziantep’teydik. Hasada katıldık, tarlalarda dolaştık ve fıstık ağaçlarına hayran kaldık.

Bugüne kadar 2 bin çiftçiye sürdürülebilir tarım uygulamaları hakkinda, yaklasik 4 bin 500 çocuğa ise Antep fıstığının önemi konusunda farkindalık yaratmak amacıyla eğitim verilirken, Antep fıstığında verim 2.5 kat arttırılmış.

Bu arada tabii ki Gaziantep’te harika yemekler yemek yerken, sokaklarında bol bol gezip fotoğraf çekme fırsatımız oldu 🥰

